import React from "react";
import "./style.css";

function SearchResults(props) {
  return (
    <table>
      <tr>
          <th>
          Name
          </th>
          <th>Phone</th>
          <th>Email</th>
          <th>Company</th>
      </tr>
      {props.results.map(result => (
      <tr>
        <td>
          <span>{result.name}</span>
        </td>
        <td>
          <span>{result.phone}</span>
        </td>
        <td>
          <span>{result.email}</span>
        </td>
        <td>
          <span>{result.company.name}</span>
        </td>
      </tr>
      ))}
    </table>
  );
}

export default SearchResults;
